// NavigationBar.js
import React from 'react';
import './NavigationBar.css';

const NavigationBar = () => {
  return (
    <nav>
      <div className="logo">C<span className="superscript">ampus</span><span>C</span><span className="subscript">onnect</span></div>
      <ul>
        <li><a href="/">Home</a></li>
        <li><a href="/blog">Blog</a></li>
        <li><a href="/events">Events</a></li>
      </ul>
    </nav>
  );
};

export default NavigationBar;
